import React from "react";
import { useEffect } from "react";
import AssesStyle from "../../../styles/Asses/Asses.css";
import SideBarComp from "../../global/SideBar";
import LogoComp from "../../global/Logo";
import { fetchUserForChoice } from "../../../redux/reducers/ShowUserForChoice";
import { useDispatch, useSelector } from "react-redux";
import LikesStyle from "../../../styles/Likes/Likes.css";

const { ContainerLikes } = LikesStyle


function Likes() {

    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(fetchUserForChoice())
    }, [])

    return (
        <>
            <LogoComp></LogoComp>
            <SideBarComp></SideBarComp>
            <ContainerLikes>
                <ContainerBidder>
                    <img src="https://catherineasquithgallery.com/uploads/posts/2021-02/1614344178_47-p-chelovek-na-svetlom-fone-51.jpg" alt="" srcset="" style={{ height: "max-content" }} />
                </ContainerBidder>
                <ContainerBtns>
                    <Btn>
                        <img src="https://img.icons8.com/?size=256&id=RFB1w7mlgenN&format=png" alt="Не нравится" srcset="" style={{ width: "50px", height: "50px", margin: "0px" }} />
                    </Btn>
                    <Btn>
                        <img src="https://img.icons8.com/?size=256&id=oEc1O2tvXKUb&format=png" alt="Нравится" srcset="" style={{ width: "50px", height: "50px", margin: "0px" }} />
                    </Btn>
                </ContainerBtns>
            </ContainerLikes>
        </>
    )
}

export default Likes
